import React from 'react';

class Form extends React.Component { 
    constructor() { 
        super (); 
        this.state= { 
          name: '', 
          email: '',
          phone: '', 
          caseType: '', 
        };
    }
    render() {
        return (
            <form>
                <label>Name
                <input name="name" type="text" value={this.state.name} />
                </label>
                <label>Email Address
                <input name="email" type="text" value={this.state.email} />
                </label>
                <label>Phone Number 
                <input name="phone" type="number" value={this.state.phone} />
                </label>
                <label>Case Type
                <select name="caseType" value={this.state.caseType}>
                <option value="personalInjury">Personal Injury </option>
                <option value="criminalDefense">Criminal Defense</option>
                <option value="businessLit">Business Litigation/option>
                <option value="familyLaw">Family Law</option>
                <option value="other">Other/Unknown</option></option>
                </select>
                </label>
            </form>
        )
    }
    }

export default Form;
